def getBestTags(bow):
    
    
    # sort by frequency
    wordsFreq = sorted(bow, key=bow.get)
    print(wordsFreq)
    onlyAlphas = []
    
    # skip non alphas
    [onlyAlphas.append(word) for word in bow if word.isalpha()]
    
    print(onlyAlphas[:-5])    
    return onlyAlphas[:-5]
    


